/* import css files  */
import "./ProductsectionMainpage.css";

const ProductSection = ({background}) => {
    return (
        <div className="Productsection__mainpage">
            <div className="producten__wrapper">
               <figure className="producten__wrapper__figure">
                <img src={background} alt="" className="producten__wrapper__figure__image"/>
               </figure>
            </div>
            <h3 classNm>Products</h3>
        </div>
    )
}

export default ProductSection;
